*
 * A mixin for Extensible behavior.
 *
 * @type {Object}
 *
 * @example
 * Object.assign(MyClass.prototype, extensibleMixin);
 * let myObject = new MyClass(),
 * myObject[extensibleSymbols.addMethod]("toString", () => "Hi");

